import{_ as s,o as t,c as a,e as r}from"./chunks/framework.7WwFwkJk.js";const e="/assets/IMG_1761.JkSX-Luy.jpg",o="/assets/IMG_1741.MFzmW57G.jpg",_="/assets/IMG_1748.4VOqIqGL.jpg",p="/assets/IMG_1757.mHPCbc_n.jpg",i="/assets/IMG_1743.jZi1JmWM.jpg",c="/assets/IMG_1767.rS1z8D6u.jpg",l="/assets/IMG_1768.dv4tD1AT.jpg",n="/assets/IMG_1769.6NmsuG-m.jpg",m="/assets/IMG_1770.wUBmEt37.jpg",g="/assets/IMG_1771.su0qmhYp.jpg",j="/assets/ZcZ8QILlMgc.982uNP-A.jpg",h="/assets/1HPlj8PSjig.oEz19V9k.jpg",G="/assets/4xNX7uWeazQ.v1Kv6Fen.jpg",I="/assets/7psigj4wGg0.qdFih7iA.jpg",k="/assets/H4yG9yEWeb4.yA8VQqKq.jpg",f="/assets/IMG_1772.fcuqPqgV.jpg",M="/assets/IMG_1773.iZhDRiiB.jpg",u="/assets/IMG_1778.iBFElG1c.jpg",d="/assets/IMG_1781.rTZPkswO.jpg",b="/assets/IMG_1782.MGuwipa1.jpg",v="/assets/IMG_1783.bjlbRTvZ.jpg",x="/assets/IMG_1784.kvnWiqBA.jpg",q="/assets/IMG_1791.lWNbylBU.jpg",y="/assets/IMG_1794.I6StdZLv.jpg",w="/assets/IMG_1796.HtvBJu8G.jpg",D="/assets/IMG_1797.0lyzRobT.jpg",P="/assets/oxAWVfvQLGU.D89mhQup.jpg",S="/assets/8-y6yqK4X1Y.j9SouF9a.jpg",N="/assets/IMG_1802.YIK6WSnZ.jpg",T="/assets/IMG_1804.F5HEumVD.jpg",A="/assets/IMG_1806.spZjUC6L.jpg",V="/assets/IMG_1785.Nh08YJNI.jpg",Q=JSON.parse('{"title":"Столярный цех на Фабрике на Даниловском рынке","description":"","frontmatter":{"title":"Столярный цех на Фабрике на Даниловском рынке","date":"2015-08-17","cover":"IMG_1762.jpg"},"headers":[],"relativePath":"practice/ooley42/danilovskiy/index.md","filePath":"practice/ooley42/danilovskiy/index.md"}'),Z={name:"practice/ooley42/danilovskiy/index.md"},B=r('<p><img src="'+e+'" alt=""><img src="'+o+'" alt=""><img src="'+_+'" alt=""><img src="'+p+'" alt=""><img src="'+i+'" alt=""></p><p>15 августа на один субботний день на Даниловском рынке Москвы возникла Фабрика ручного труда, где каждый желающий мог поработать в любом из её цехов и сделать какой-нибудь предмет быта своими руками. Такое неожиданное преображение рынка стало возможно благодаря его сотрудничеству с командой <a href="http://theoryandpractice.ru/" class="external-link" target="_blank" rel="noreferrer">портала «Теории и практики»</a>.</p><p><img src="'+c+'" alt=""><img src="'+l+'" alt=""><img src="'+n+'" alt=""><img src="'+m+'" alt=""><img src="'+g+'" alt=""></p><p>Фабрика состояла из 6 разнонаправленных цехов. Каждый желающий при входе на рынок мог приобрести за 300 рублей билет, позволяющий поработать в одном из цехов и получить вещь, сделанную своими руками. В вязальном цехе мастерицы из <a href="http://craftslab.ru/" class="external-link" target="_blank" rel="noreferrer">Craft Lab</a> обучали изготовлению трикотажных ковриков. <a href="https://www.facebook.com/panikapost" class="external-link" target="_blank" rel="noreferrer">Panika Derevya</a> помогала сшить и ракрасить наволочку для интерьерной подушки в швейном цехе. <a href="https://www.facebook.com/DashDashCosmetics" class="external-link" target="_blank" rel="noreferrer">Dash_Dash Natural Cosmetics</a> предоставили десятки особенных ингредиентов для создания неповторимого крема-мусса. <a href="http://monolama.ru/" class="external-link" target="_blank" rel="noreferrer">Студия Monolama</a> подготовила множество деталей для создания значков из оргстекла в конструкторском цехе. <a href="https://vk.com/o_horosho" class="external-link" target="_blank" rel="noreferrer">Сервис &quot;Очень хорошо&quot;</a> делился навыками создания букетов из овощей в цветочном цехе. А в столярном цехе <a href="https://www.facebook.com/rukiottuda" class="external-link" target="_blank" rel="noreferrer">мастерская &quot;Рукиоттуда&quot;</a> благотворительного <a href="http://vverh.su/" class="external-link" target="_blank" rel="noreferrer">центра &quot;Вверх&quot;</a> при поддержке команды OOLEY дала возможность каждому желающему самостоятельно изготовить разделочную доску авторского дизайна.</p><p><img src="'+j+'" alt=""></p><p><img src="'+h+'" alt=""><img src="'+G+'" alt=""><img src="'+I+'" alt=""></p><p><img src="'+k+'" alt=""></p><p><img src="'+f+'" alt=""><img src="'+M+'" alt=""><img src="'+u+'" alt=""><img src="'+d+'" alt=""><img src="'+b+'" alt=""><img src="'+v+'" alt=""><img src="'+x+'" alt=""></p><p><img src="'+q+'" alt=""><img src="'+y+'" alt=""><img src="'+w+'" alt=""><img src="'+D+'" alt=""><img src="'+P+'" alt=""></p><p>Начав принимать участников в 14:00, Фабрика сразу загрузила свои мощности и всего за 4 часа работы дала возможность творческого самовыражения более ста участникам. В одном только столярном цеху посетители рынка смогли произвести более двадцати уникальных разделочных досок. Самостоятельно разработанную форму доски участники цеха сами вырезали из букового щита электролобзиком. Тщательно ошлифовав поверхности наждачной бумагой и нанеся рисунки выжигательным аппаратом, гости Фабрики покрыли изделия специальным маслом.</p><p>Две диковинных рыбы, знак Бетмена, кит, виолончель, гитара, два Питера Гриффина, тесак, овал и различные абстрактные формы — участники цеха нашли выход своей фантазии и сделали разделочные доски настоящим средством самовыражения. Затратив в среднем около полутора-двух часов на работу, каждый из них получил не только уникальный предмет быта, но и удовольствие самостоятельного творчества, а также ценные навыки, которые могут пригодиться во многих жизненных ситуациях.</p><p><img src="'+S+'" alt=""><img src="'+N+'" alt=""><img src="'+T+'" alt=""><img src="'+A+'" alt=""><img src="'+V+'" alt=""></p>',12),E=[B];function L(W,C,F,z,H,J){return t(),a("div",null,E)}const Y=s(Z,[["render",L]]);export{Q as __pageData,Y as default};
